// App.js

import React, { Component } from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero.js'

class App extends Component {
  render() {
    return (
    <div className='app'>
      <Navbar />
      <Hero />
    </div>
    );
  }
}

export default App;
